&quot;Standard Catalog of&quot; World Coins 2001-Date: 2010-Colin (digital copy)

Rapid growth of the collector coin market and a recordsetting precious metals market prompts collectors to seek a rapid and reliable response to the daily changing coin climate. This new edition of the ultimate 21st century world coin catalogue brings collectors of all worldly coin interests to a level collecting field with identifying details for all 21st century coinage, including recent new issues, and nearly 90,000 values, in five condition grades.


